import React from "react";

export const ModelsList = ({models}) => {
    return (
        <table className="highlight">
            <thead>
            <tr>
                <th>Name</th>
                <th>Item Name</th>
                <th>Item Price</th>
            </tr>
            </thead>

            <tbody>
            {models.map(model => {
                return (
                    <tr>
                        <td>Alvin</td>
                        <td>Eclair</td>
                        <td>$0.87</td>
                    </tr>
                )
            })}

            </tbody>
        </table>
    )
}
